import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import FormHelperText from '@material-ui/core/FormHelperText';

const inputStyles = makeStyles({
    root: {
      width: '100%',
    },
});

function OriVASP() {
    const classes = inputStyles();
    return (
      <div>
        <Typography variant="h6" gutterBottom className="title label_title">
          Originator VASP code
        </Typography>
        <TextField id="oriCode" defaultValue="-"
          InputProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function BeneVASP() {
    const classes = inputStyles();
    return (
      <div>
        <Typography variant="h6" gutterBottom className="title label_title">
          Beneficiary VASP code
        </Typography>
        <TextField id="beneCode" defaultValue="-"
          InputProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function Result() {
    const classes = inputStyles();
    return (
      <div>
        <Typography variant="h6" gutterBottom className="title label_title">
          Beneficiary VASP code
        </Typography>
        <TextField id="result" defaultValue="-"
          InputProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

const useStyles = makeStyles((theme) => ({
    root: {
      border: '1px solid #666' ,
      padding: '30px 20px',
    },
    capitalize: {
      textTransform: 'capitalize',
      marginBottom: '15px',
    },
}));

function Bridge() {
    const classes = useStyles();
    return (
      <React.Fragment>
      <Typography variant="h5" color="inherit" className={classes.capitalize}>
        Bridge Service
      </Typography>
        <div className={classes.root}>
            <form action="">
                <OriVASP />
                <BeneVASP />
                <Result />
            </form>
        </div>
        </React.Fragment>
    );
}

export default Bridge;
